1545,\"_3674\":3701,\"_3689\":3094},{\"_3672\":20,\"_3674\":3696},{},1757983430.967,{\"_3678\":3679,\"_3680\":3699},[3700],\"my figma graph is nested within a frame and now i cannot move objects around freely. how do i fix\",{\"_3702\":3703,\"_3704\":3705,\"_3708\":3709,\"_3710\":-5,\"_3711\":3712,\"_3688\":3648},\"selected_github_repos\",[],\"serialization_metadata\",{\"_3706\":3707},\"custom_symbol_offsets\",[],\"request_id\",\"97fc54fc8f15a629-IAD\",\"message_source\",\"timestamp_\",\"absolute\",[3714],\"bf893fd0-7aea-4b9e-b62f-864b2d754fb3\",{\"_26\":3714,\"_3668\":3716,\"_3690\":3692,\"_3664\":3733},{\"_26\":3714,\"_3670\":3717,\"_3656\":3720,\"_3676\":3721,\"_3682\":3683,\"_3685\":1545,\"_3674\":3724,\"_3689\":3094},{\"_3672\":3718,\"_3674\":3719},\"assistant\",{},1757983431.2771785,{\"_3678\":3722,\"_3723\":23},\"model_editable_context\",\"model_set_context\",{\"_3708\":3709,\"_3725\":3726,\"_3727\":3728,\"_3729\":3730,\"_3731\":3692,\"_3711\":3712,\"_3688\":3648,\"_3732\":47},\"message_type\",\"next\",\"model_slug\",\"gpt-5\",\"default_model_slug\",\"auto\",\"parent_id\",\"is_redacted\",[3734],\"55bbbc52-7db9-40fb-9605-f0f46a49dc64\",{\"_26\":3734,\"_3668\":3736,\"_3690\":3714,\"_3664\":3755},{\"_26\":3734,\"_3670\":3737,\"_3656\":3739,\"_3676\":3740,\"_3682\":3683,\"_3684\":47,\"_3685\":1545,\"_3674\":3743,\"_3689\":3094},{\"_3672\":3718,\"_3674\":3738},{},1757983431.295415,{\"_3678\":3679,\"_3680\":3741},[3742],\"This usually happens in Figma when your objects are **inside a Frame or Auto Layout container** that’s constraining their position. A few ways to fix it:\\n\\n1. **Check if the frame has Auto Layout applied**  \\n   - Select the parent frame in the left layers panel.  \\n   - If you see *Auto Layout* properties in the right sidebar, that means elements are being auto-arranged.  \\n   - You can either:  \\n     - Remove Auto Layout (`Right-click → Remove Auto Layout`), or  \\n     - Adjust padding, spacing, and alignment to allow freer movement.\\n
